import{_ as r,D as s,c as n,I as o,l as e,a as i,a3 as a,o as l}from"./chunks/framework.CN2TXM7E.js";const S=JSON.parse('{"title":"Nodes Tree & Object Imports","description":"","frontmatter":{},"headers":[],"relativePath":"astronomers/nights/explorer/nodestree.md","filePath":"astronomers/nights/explorer/nodestree.md"}'),d={name:"astronomers/nights/explorer/nodestree.md"},c=e("h1",{id:"nodes-tree-object-imports",tabindex:"-1"},[i("Nodes Tree & Object Imports "),e("a",{class:"header-anchor",href:"#nodes-tree-object-imports","aria-label":'Permalink to "Nodes Tree & Object Imports"'},"​")],-1),h=e("div",{class:"warning custom-block"},[e("p",{class:"custom-block-title"},"WARNING"),e("p",null,"Many screenshots are still those of V4, until we take new ones from production site.")],-1),p=a('<p>The Nodes Tree is a key component of iObserve, as it holds the organisation of targets into folders.</p><p>Note that public &amp; free access to iObserve has a restricted number of nodes, and no folders. Visit the <a href="https://www.arcsecond.io/pricing#iobserve" target="_blank" rel="noreferrer">Pricing</a> page for subscribing. <strong>Students get 50% off.</strong></p><p>Each non-folder node has a target associated to it. It can be of type:</p><ul><li>Astronomical Object</li><li>Exoplanet</li><li>Small Body (Asteroid or Comet)</li><li>Solar System Planet</li></ul><p>Apart from the planets of our Solar System (whose properties are directly computed by the web app), all other types of objects are imported by requesting <a href="https://api.arcsecond.io" target="_blank" rel="noreferrer">https://api.arcsecond.io</a> which in turn request professional sources: <a href="http://simbad.cds.unistra.fr/simbad/" target="_blank" rel="noreferrer">SIMBAD</a> of the <a href="https://cds.u-strasbg.fr" target="_blank" rel="noreferrer">CDS</a> (Strasbourg, France), <a href="https://exoplanetarchive.ipac.caltech.edu/index.html" target="_blank" rel="noreferrer">NASA Exoplanet Archive</a> (IPAC, Caltech, USA) and the <a href="https://ssd-api.jpl.nasa.gov" target="_blank" rel="noreferrer">SSD/CNEOS service</a> from the <a href="https://www.jpl.nasa.gov" target="_blank" rel="noreferrer">JPL</a> (USA).</p><div style="clear:right;"></div><h2 id="action-buttons" tabindex="-1">Action Buttons <a class="header-anchor" href="#action-buttons" aria-label="Permalink to &quot;Action Buttons&quot;">​</a></h2>',7),f=a('<p>The first two action buttons allow to import targets &amp; create folders. See <a href="./layoutoptions">Global Layout &amp; Options</a> about the last two buttons.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The little &quot;link&quot; icon to the right of the &quot;Targets&quot; title indicates whether the nodes tree is in sync with its remote. See <a href="#nodes-tree-sync">Nodes Tree Sync</a> below.</p></div><h2 id="object-import-nodes" tabindex="-1">Object Import &amp; Nodes <a class="header-anchor" href="#object-import-nodes" aria-label="Permalink to &quot;Object Import &amp; Nodes&quot;">​</a></h2><p>To import an object, press the &quot;+&quot; button. It will open a modal, starting with the &quot;Aladin&quot; tab selected.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Because of packaging issues, Aladin cannot be embedded into the desktop app of Arcsecond. It works only in the standard web inside a navigator. Unfortunately, it is not an easy task to update this packaging to adopt modern tools.</p></div><h2 id="folder-nodes" tabindex="-1">Folder Nodes <a class="header-anchor" href="#folder-nodes" aria-label="Permalink to &quot;Folder Nodes&quot;">​</a></h2><p>To create a folder node, somply press the &quot;folder&quot; button. It will immediately create a folder node (without any modal). If an object node is selected, the folder will be created just after it. If a folder node is currently selected, the new folder will be created inside it. If no node is selected, the folder is created at the end of the nodes tree, at the root level.</p><h2 id="the-options-menu" tabindex="-1">The Options Menu <a class="header-anchor" href="#the-options-menu" aria-label="Permalink to &quot;The Options Menu&quot;">​</a></h2><h2 id="nodes-tree-sync" tabindex="-1">Nodes Tree Sync <a class="header-anchor" href="#nodes-tree-sync" aria-label="Permalink to &quot;Nodes Tree Sync&quot;">​</a></h2>',9);function m(b,u,_,g,T,k){const t=s("ThemedImage");return l(),n("div",null,[c,h,o(t,{prefix:"iobserve-nodes-tree",alt:"The tree of nodes of iObserve",maxWidth:"15rem",float:"right"}),p,o(t,{prefix:"iobserve-nodes-tree-action-buttons",alt:"The tree of nodes of iObserve",maxWidth:"15rem",float:"right"}),f])}const y=r(d,[["render",m]]);export{S as __pageData,y as default};
